# Ejercicio 2.
import numpy as np
import pandas as pd

# Verificar si un número es potencia de dos.
def potencia_de_dos(num, potencia=2): # num es el número a evaluar.
  while potencia <= num:
    if potencia == num:
      return True
    potencia = potencia*2 # Sacamos potencia de 2 hasta que alcance o exceda el número.
  return False

# Función para llenar la matriz con el caso base.
def Llenar_cuadrante(cuadrante,a,n): # a vale 1 si es potencia de 2 o 0 si no lo es, esto para equilibrar los indices.
# 1 y -1 son para organizar los indices al valor, es decir, el jugador 1 está en el indice 0.
  if cuadrante == "SD": # Cuadrante superior derecho.
    for jugador in range(int(n/2)): # Inicio del cuadrante -> Mitad.
      for dia in range(int(n/2-a),int(n-1)): # Mitad del cuadrante -> Final.
        encuentros[jugador,dia]=jugador+1+dia+1
        if encuentros[jugador,dia] > n: # Se evalua que al rotar no haya sobrepasado n o 0.
          encuentros[jugador,dia]=encuentros[jugador,dia]-(int(n/2))
  elif cuadrante == "ID": # Cuadrante inferior derecho.
    for jugador in range(int(n/2),int(n)): # Mitad del cuadrante -> Final.
      for dia in range(int(n/2)-a,int(n-1)): # Mitad del cuadrante -> Final.
        encuentros[jugador,dia]=(jugador+1)-(dia+1)
        if encuentros[jugador,dia] <= 0: # Se evalua que al rotar no haya sobrepasado n o 0.
          encuentros[jugador,dia]=encuentros[jugador,dia]+(int(n/2))
  elif cuadrante == "IZ": # Cuadrante inferior izquierdo.
    for jugador in range(int(n/2),int(n)): # Mitad del cuadrante -> Final.
      for dia in range(int((n/2)-a)): # Inicio del cuadrante -> Mitad.
        if a == 1: # Caso para potencia de dos.
          encuentros[jugador,dia]=encuentros[jugador-int(n/2),dia]+(int(n/2))
        elif encuentros[int(jugador-(n/2)),dia]!=0: # Caso para par no potencia de dos (Cambia por los ceros de la solución base).
          encuentros[jugador,dia]= encuentros[int(jugador-(n/2)),dia] + (n/2)

# Función principal, llena la matriz con los enfrentamientos del torneo.
def torneo(n): # n es cantidad de jugadores.
# Caso base (mínimo)
  if n == 2: # Solo hay una forma de enfrentarlos.
    encuentros[0,0]=2
    encuentros[1,0]=1
# Potencia de dos
  elif potencia_de_dos(n):
    torneo(n/2)
    # Cuadrante superior derecho.
    Llenar_cuadrante("SD",1,n)
    # Cuadrante inferior derecho.
    Llenar_cuadrante("ID",1,n)
    # Cuadrante inferior izquierdo.
    Llenar_cuadrante("IZ",1,n)
# Par no potencia de dos
  elif (n%2)==0:
    torneo(n/2)
    # Cuadrante superior derecho.
    Llenar_cuadrante("SD",0,n)
    # Cuadrante inferior derecho.
    Llenar_cuadrante("ID",0,n)
    # Cuadrante inferior izquierdo
    Llenar_cuadrante("IZ",0,n)
    # Reemplazamos ceros de la parte izquierda (Ocasionados ya que el cuadrado base era impar).
    for jugador in range(int(n/2)): # Izquierda superior.
      for dia in range(int(n/2)):
        if encuentros[jugador,dia] == 0:
          encuentros[jugador,dia] = jugador + 1 + (n/2)
    for jugador in range(int(n/2),int(n)): # Izquierda inferior.
      for dia in range(int(n/2)):
        if encuentros[jugador,dia] == 0:
          encuentros[jugador,dia] = jugador + 1 - (n/2)
# Si es impar
  else:
    torneo(n+1) # Calculamos el caso par siguiente a n.
    # Eliminamos los datos donde está n+1, además la ultima fila que corresponde a este jugador.
    for jugador in range(int(n+1)):
      for dia in range(int(n)):
        if encuentros[jugador,dia]== n+1 or jugador == n:
          encuentros[jugador,dia] = 0

# Función para pasar la matriz a Pandas e imprimir.
def generar_tabla(a=1): # a vale 1 si es par o 0 si es impar.
  for row in range(n): # Recorremos filas y creamos las etiquetas de las filas.
    filas.append(f"Jugador {row+1}")
  for column in range(n-a): # Recorremos columnas y creamos los campos.
    columnas.append(f"Dia {column+1}")
  tabla = pd.DataFrame(encuentros[0:n,0:n-a], index=filas,columns=columnas) # Lo volvemos DataFrame y actualizamos.
  if a == 0: # Si es impar cambiamos los ceros que indican descanso por Ds.
    tabla=tabla.replace([0],"Ds")
  display(tabla) # Mostramos la tabla.

n=int(input("Ingrese la cantidad de jugadores (necesario que sea mayor que 0): ")) # Solicitamos el número de jugadores.
Max=n+1 # Creamos una variable máxima para crear la matriz de ceros.
encuentros=np.zeros((Max,Max)).astype(int) # Creamos la matriz.
# Listas necesarias para crear la tabla en Pandas.
filas=[]
columnas=[]

torneo(n) # Ejecutamos la función principal
if n%2 == 0: # Mostramos la tabla, dando como parámetro si es par o impar.
  generar_tabla(1)
else:
  generar_tabla(0)